function sumPrimes(num) {
  let array=[]

  for(let i=2;i<=num;i++){
    if(isPrimeNumber(i)){
      array.push(i)
    }


  }
  return array.reduce((a,b)=>{
    return a+b
  })
}

function isPrimeNumber(num){
  for(let x=2;x<num;x++){
    if(num%x===0){
      return false
    }
  }
  return true
}

sumPrimes(10);
